import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="bg-gray-900 text-white p-4">
        <h1 className="text-2xl font-bold">Griefing Group Website</h1>
      </header>
      
      <main className="container mx-auto px-4 py-8">
        <div className="text-center">
          <h2 className="text-3xl font-bold mb-4">Welcome to Our Griefing Group</h2>
          <p className="text-gray-600">Website is under construction...</p>
          <div className="mt-8">
            <p className="text-sm text-gray-500">
              Run <code className="bg-gray-100 px-2 py-1 rounded">npm install</code> in the frontend directory to install dependencies.
            </p>
          </div>
        </div>
      </main>
    </div>
  );
}

export default App;
